import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Athlete from "./components/athlete";
import Header from "./components/header";

function App() {
  return (
    <div className="App">


      <Header turvataso="keskisuuri"/>
      <div className="container">
        <Athlete firstName="Rauno" lastName="Repomies"/>
        <Athlete firstName="Pekka" lastName="Routalempi"/>
      </div>



    </div>
  );
}

export default App;
